import { HashRouter as Router, Routes, Route } from 'react-router-dom';
import { Home } from './Pages/Home';

import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <h1>
          Holas
        </h1>

        <Router>
          <Routes>
            <Route path="/" element={<Home/>} />


          </Routes>
        </Router>




      </header>
    </div>
  );
}

export default App;
